DROP TABLE IF EXISTS `t_member`;
CREATE TABLE `t_member` (
  `pk_id` varchar(255) NOT NULL,
  `c_name` varchar(255) NOT NULL,
  `c_realName` varchar(255) DEFAULT NULL,
  `c_background` varchar(255) DEFAULT NULL,
  `c_age` tinyint(3) DEFAULT NULL,
  `c_gender` tinyint(1) NOT NULL DEFAULT '0',
  `c_password` varchar(255) DEFAULT NULL,
  `c_email` varchar(255) DEFAULT NULL,
  `c_phone` varchar(255) DEFAULT NULL,
  `c_wxId` varchar(255) DEFAULT NULL,
  `c_qqId` varchar(255) DEFAULT NULL,
  `c_image` varchar(255) DEFAULT NULL,
  `c_skillScore` int(11) NOT NULL DEFAULT '0',
  `c_creditScore` int(11) NOT NULL DEFAULT '0',
  `c_fans` int(11) NOT NULL DEFAULT '0',
  `c_trades` int(11) NOT NULL DEFAULT '0',
  `c_agrees` int(11) NOT NULL DEFAULT '0',
  `c_visitors` int(11) NOT NULL DEFAULT '0',
  `c_citycode` varchar(50) DEFAULT NULL,
  `c_province_name` varchar(255) DEFAULT NULL,
  `c_city_name` varchar(255) DEFAULT NULL,
  `c_address` varchar(255) DEFAULT NULL,
  `c_type` varchar(5) NOT NULL,
  `c_status` tinyint(1) NOT NULL DEFAULT '1',
  `c_phoneAuth` tinyint(1) NOT NULL DEFAULT '0',
  `c_companyAuth` tinyint(1) NOT NULL DEFAULT '0',
  `c_personAuth` tinyint(1) NOT NULL DEFAULT '0',
  `c_longitude` varchar(255) DEFAULT NULL,
  `c_latitude` varchar(255) DEFAULT NULL,
  `c_createDate` datetime NOT NULL,
  `c_createBy` varchar(255) NOT NULL,
  `c_updateDate` datetime NOT NULL,
  `c_updateBy` varchar(255) NOT NULL,
  PRIMARY KEY (`pk_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

