-- Table structure for t_permission
-- ----------------------------
DROP TABLE IF EXISTS `t_permission`;
CREATE TABLE `t_permission` (
  `pk_id` varchar(255) NOT NULL,
  `c_name` varchar(255) NOT NULL,
  `c_icon` varchar(255) DEFAULT NULL,
  `c_level` int(2) NOT NULL,
  `c_code` varchar(255) NOT NULL,
  `c_description` varchar(255) DEFAULT NULL,
  `c_status` int(2) NOT NULL,
  `c_url` varchar(255) DEFAULT NULL,
  `c_parentid` varchar(255) DEFAULT NULL,
  `c_type` int(2) DEFAULT NULL,
  `c_sort` int(11) NOT NULL,
  `c_createDate` datetime NOT NULL,
  `c_createBy` varchar(255) NOT NULL,
  PRIMARY KEY (`pk_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

